import React, { Component } from "react";

class Table extends Component {
  render() {
    return (
      <tbody className="table">
        <tr>
            <th scope="col">#</th>
            <th scope="col">Name</th>
            <th scope="col">Price</th>
          </tr>
      </tbody>
    );
  }
}

export default Table;
